import React from "react";
import moment from 'moment'

const Weathercomp = props => (


		<table>
			<tbody>
			<tr>
			<td colSpan="2">
			{props.error && 
			<div>{props.error}</div>
		}
			</td>
			</tr>
				<tr>
				<td className="weather__key">
				{ 	
		 			props.Temperature && 
		 			<span className="weather__value"> { props.Temperature }	</span>
		 		}
				</td>
				<td className="weather__key">
				{	
		 			props.city && props.country && 
		 			<div className="weather__value"> { props.city }, { props.country }</div>
		 		}
		 		{
		 			props.description && 
					<div>{moment(props.Datecity).format('llll')}</div> 
				}	
		 		{
		 			props.description && 
		 			<span className="weather__value"> { props.description } </span>



		 		}	 		



				</td>
				</tr>


			</tbody>

		</table>









);


export default Weathercomp;
